      })
      console.log(images)
      setImage(images)
    } catch (e) {
      // ...
    }

  }

  return (
    <div className="App" >
      <Navbar/>
      <h1>Hello</h1>
      <img src={`${image[0]}`} width={"250px"} height={"auto"}/> 

      <button onClick={async ()=>{
        await AIimage();
      }}>generate Image</button>




    </div>
  );
}

export default App;
